  width: 100%;
`;

const TeamTitle = styled.div`
  font-family: Nunito;
  font-weight: bold;
  font-size: 36px;
  line-height: 43.2px;
  text-align: center;
  color: #918fb3;
`;

const TeamCard = styled.div`
  display: flex;
  width: 330px;
  height: 316px;
  background: #e9f1f2;
  margin-bottom: 24px;
