  display: flex;
  width: 330px;
  height: 228px;
  background: #e9f1f2;
  margin-bottom: 24px;
  margin-left: 24px;
  margin-top: 32px;
  border: 1px solid #b7b7b7;
`;

const CardTeamTitle = styled.div`
  display: flex;
  font-family: Nunito;
  font-weight: bold;
  font-size: 30px;
  line-height: 36px;
  text-align: left;
  color: #666;
`;

const CardSubtitle = styled.div`
  display: flex;
  font-family: Nunito-Italic;
  font-weight: normal;
  font-size: 28px;
  line-height: 33.6px;
  text-align: left;
  color: #666;
`;

const Equipe = () => {
    return(
        <div>
<TeamTitle>A equipe</TeamTitle>
