    <Card.Title>João Pereira, 30</Card.Title>
    <Card.Text>
    Desenvolvedor
    </Card.Text>
  </Card.Body>
</Card>
            <TeamCard>
              <CardTeamTitle>Branca Silva, 33</CardTeamTitle>
              <CardSubtitle>Analista de qualidade</CardSubtitle>
            </TeamCard>
            <TeamCard>
              <CardTeamTitle>Carlos Gomes, 46 </CardTeamTitle>
              <CardSubtitle>Desenvolvedor Fullstack</CardSubtitle>
            </TeamCard>
          </Row>
          <Row>
            <TeamCard2>
              <CardTeamTitle>João Pereira, 30</CardTeamTitle>
              <CardSubtitle>Desenvolvedor</CardSubtitle>
            </TeamCard2>
            <TeamCard2>
              <CardTeamTitle>João Pereira, 30</CardTeamTitle>
              <CardSubtitle>Desenvolvedor</CardSubtitle>
            </TeamCard2>
          </Row>
          <Row>
            <TeamCard3>
              <CardTeamTitle>João Pereira, 30</CardTeamTitle>
              <CardSubtitle>Desenvolvedor</CardSubtitle>
            </TeamCard3>
            <TeamCard2>
              <CardTeamTitle>João Pereira, 30</CardTeamTitle>
              <CardSubtitle>Desenvolvedor</CardSubtitle>
            </TeamCard2>
            <TeamCard2>
              <CardTeamTitle>João Pereira, 30</CardTeamTitle>
              <CardSubtitle>Desenvolvedor</CardSubtitle>
            </TeamCard2>
          </Row>
          <Row>
            <TeamCard>
              <CardTeamTitle>João Pereira, 30</CardTeamTitle>
              <CardSubtitle>Desenvolvedor</CardSubtitle>
            </TeamCard>
            <TeamCard2>
              <CardTeamTitle>João Pereira, 30</CardTeamTitle>
              <CardSubtitle>Desenvolvedor</CardSubtitle>
            </TeamCard2>
            <TeamCard3>
              <CardTeamTitle>João Pereira, 30</CardTeamTitle>
              <CardSubtitle>Desenvolvedor</CardSubtitle>
            </TeamCard3>
          </Row>
        </Team>
        </div>
    )
}

export default Equipe
